function c = solve_vector()
    a = [-2; 5];
    b = [1; 3];

    % The vector c is a scalar multiple of a, so c = k * a for some scalar k.
    % Since b bisects the angle between a and c, the vectors a and c have the same direction.
    % Therefore, c = k * a for some positive scalar k.

    k = 1 / norm(b);
    c = k * a;
end

