function probability = shaded_region_probability()
    % The total area of the target is the area of the largest circle (10 inches radius)
    total_area = pi * 10^2;

    % The shaded area is the area of the largest circle minus the area of the three smaller circles
    shaded_area = total_area - pi * 4^2 - pi * 6^2 - pi * 8^2;

    % The probability of hitting the shaded region is the ratio of the shaded area to the total area
    probability = shaded_area / total_area;
end

probability = shaded_region_probability();
printf('%.15g\n', probability)
```
