function [a, b, c] = parabola_coefficients(points)
  % Extract the points
  x = points(:, 1);
  y = points(:, 2);

  % Calculate the coefficients
  a = (y(2) - y(1)) / (x(2) - x(1))^2;
  b = (y(3) - y(1) - a * (x(3) - x(1))^2) / (x(2) - x(1));
  c = y(1) - a * x(1)^2 - b * x(1);
