% The area of each quarter-circle is (1/4)*pi*4^2 = 4*pi square units.
% Therefore, the area of the non-shaded region is 32 - 2*4*pi = 32 - 8*pi square units.

area = 32 - 8*pi;
printf('%.15g\n', area);

