% There are 4 players, each spinning once. The spinner can select either an arm or a leg, and one of four colors, one of which is red.
% We want to find the probability that in these four spins, there will be exactly two moves to a red spot, and the body part selected to move will be an arm exactly 3 times.

% Let's denote the probability of selecting an arm as p_arm and the probability of selecting red as p_red.
% Since the spinner selects either an arm or a leg and one of four colors, each with equal probability, we have p_arm = p_leg = 1/2 and p_red = p_other = 1/2.

% We can use the binomial probability formula to calculate the probability of exactly two moves to a red spot and the body part selected to move will be an arm exactly 3 times.
% The binomial probability formula is P(X=k) = C(n, k) * (p^k) * ((1-p)^(n-k)), where n is the number of trials, k is the number of successful trials, p is the probability of success, and C(n, k) is the number of combinations of n items taken k at a time.

% In this case, n = 4 (the number of spins), k = 2 (the number of moves to a red spot), and p = p_arm * p_red = 1/4 (the probability of selecting an arm and red).

% The number of combinations of 4 items taken 2 at a time is C(4, 2) = 6.

% So, the probability is P(X=2) = C(4, 2) * (1/4)^2 * (3/4)^2 = 6 * (1/16) * (9/16) = 54/256.

p_arm = 1/2;
p_red = 1/2;
n = 4;
k = 2;
p = p_arm * p_red;
C_n_k = nchoosek(n, k);
probability = C_n_k * (p^k) * ((1-p)^(n-k));

printf('%.15g\n', probability)

