function angle = find_angle
  % The direction vectors of the lines are given by the coefficients of x, y, z in the equations
  % 2x = 3y = -z, and 6x = -y = -4z.
  % The direction vector of the first line is (2, 3, -1), and the direction vector of the second line is (6, -1, -4).
  % The angle between two lines is given by the formula:
  % angle = arccos( (a . b) / (||a|| ||b||) ), where a and b are the direction vectors of the lines, and '.' denotes the dot product.
  a = [2, 3, -1];
  b = [6, -1, -4];
  dot_product = a(1)*b(1) + a(2)*b(2) + a(3)*b(3);
  norm_a = sqrt(a(1)^2 + a(2)^2 + a(3)^2);
  norm_b = sqrt(b(1)^2 + b(2)^2 + b(3)^2);
  angle = acos(dot_product / (norm_a * norm_b)) * 180 / pi;
end

