octave_code:
% Given that the area of triangle ABE is 40 and the side length of the square is 10,
% we can use the formula for the area of a triangle (1/2 * base * height) to find the height of the triangle.
% The base of the triangle is the side length of the square, so the height of the triangle is 2 * area / base.

base = 10;
area = 40;
height = 2 * area / base;

% Since E is on BC, the height of the triangle is the same as the height of the square.
% Therefore, BE is the difference between the height of the square and the height of the triangle.

BE = height - base;

% Print the result
printf('%.15g\n', BE);

