% so the area of the circular field is pi*r^2 = pi*(500/2)^2 = 125000*pi square meters.
% The area of the land that is not watered is the area of the square minus the area of the circular field.

area_square = 500^2;
area_circle = 125000*pi;
area_not_watered = area_square - area_circle;

