function v = solve_vector()
    a = [1; 1; 1];
    dot_product = 2;
    cross_product = [1; -2; 1];

    % From the cross product, we know that v = a x (a x v) = a x cross_product
    % From the dot product, we know that a . v = dot_product
    % So, we can set up the following system of equations:
    % a . (a x cross_product) = dot_product
    % a x (a x cross_product) = cross_product

    % Solve for v
    v = cross_product - (dot_product / (a' * cross_product)) * a;
end

