function paths = count_paths(w, h)
    % Create a matrix to store the number of paths to each cell
    paths = zeros(h, w);

    % There is only one path to each cell in the first row and first column
    paths(1:h, 1) = 1;
    paths(1, 1:w) = 1;

    % For each cell in the grid, calculate the number of paths to it
    for i = 2:h
        for j = 2:w
            paths(i, j) = paths(i-1, j) + paths(i, j-1);
        end
    end

    % The number of paths to the bottom-right cell is the answer
    paths = paths(h, w);
end

w = 6;
h = 3;
paths = count_paths(w, h);
printf('%.15g\n', paths)

